import React from "react";
import "./App.css";

function App() {
  const users = [
    { name: "carl", age: 21 },
    { name: "carl", age: 21 },
    { name: "carl", age: 21 },
  ];

  return (
    <div className="App">
      <h1>{users[0].name}</h1>
      {users.map((user, key) => (
        <div key={key}>
          <h1 className="Title">
            {user.name} {user.age}
          </h1>
        </div>
      ))}
    </div>
  );
}

export default App;
